B.a5p=new A.dp("The only bad workout is the one that didn't happen.","\u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0627\u0644\u0648\u062d\u064a\u062f \u0627\u0644\u0633\u064a\u0621 \u0647\u0648 \u0627\u0644\u0630\u064a \u0644\u0645 \u062a\u0642\u0645 \u0628\u0647.")
B.a5r=new A.dp("Action is the foundational key to all success.","\u0627\u0644\u0639\u0645\u0644 \u0647\u0648 \u0627\u0644\u0645\u0641\u062a\u0627\u062d \u0627\u0644\u0623\u0633\u0627\u0633\u064a \u0644\u0643\u0644 \u0646\u062c\u0627\u062d.")
B.a5i=new A.dp("Don't stop when you're tired. Stop when you're done.","\u0644\u0627 \u062a\u062a\u0648\u0642\u0641 \u0639\u0646\u062f\u0645\u0627 \u062a\u062a\u0639\u0628\u060c \u062a\u0648\u0642\u0641 \u0639\u0646\u062f\u0645\u0627 \u062a\u0646\u062a\u0647\u064a.")
B.a5q=new A.dp("Your body can stand almost anything. It\u2019s your mind that you have to convince.","\u062c\u0633\u0645\u0643 \u064a\u062a\u062d\u0645\u0644 \u0643\u0644 \u0634\u064a\u0621 \u062a\u0642\u0631\u064a\u0628\u064b\u0627. \u0639\u0642\u0644\u0643 \u0647\u0648 \u0645\u0627 \u064a\u062c\u0628 \u0639\u0644\u064a\u0643 \u0625\u0642\u0646\u0627\u0639\u0647.")
B.a5m=new A.dp("Fitness is not about being better than someone else. It\u2019s about being better than you were yesterday.","\u0627\u0644\u0644\u064a\u0627\u0642\u0629 \u0644\u064a\u0633\u062a \u0623\u0646 \u062a\u0643\u0648\u0646 \u0623\u0641\u0636\u0644 \u0645\u0646 \u0634\u062e\u0635 \u0622\u062e\u0631\u060c \u0628\u0644 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0623\u0641\u0636\u0644 \u0645\u0645\u0627 \u0643\u0646\u062a \u0639\u0644\u064a\u0647 \u0628\u0627\u0644\u0623\u0645\u0633.")
B.a5x=new A.dp("Discipline is doing what needs to be done, even if you don't want to do it.","\u0627\u0644\u0627\u0646\u0636\u0628\u0627\u0637 \u0647\u0648 \u0641\u0639\u0644 \u0645\u0627 \u064a\u062c\u0628 \u0641\u0639\u0644\u0647\u060c \u062d\u062a\u0649 \u0644\u0648 \u0644\u0645 \u062a\u0643\u0646 \u062a\u0631\u063a\u0628 \u0641\u064a \u0630\u0644\u0643.")
B.a5n=new A.dp("Success starts with self-discipline.","\u0627\u0644\u0646\u062c\u0627\u062d \u064a\u0628\u062f\u0623 \u0628\u0627\u0644\u0627\u0646\u0636\u0628\u0627\u0637 \u0627\u0644\u0630\u0627\u062a\u064a.")
B.a5v=new A.dp("The pain you feel today will be the strength you feel tomorrow.","\u0627\u0644\u0623\u0644\u0645 \u0627\u0644\u0630\u064a \u062a\u0634\u0639\u0631 \u0628\u0647 \u0627\u0644\u064a\u0648\u0645 \u0633\u064a\u0643\u0648\u0646 \u0627\u0644\u0642\u0648\u0629 \u0627\u0644\u062a\u064a \u062a\u0634\u0639\u0631 \u0628\u0647\u0627 \u063a\u062f\u064b\u0627.")
B.a5g=new A.dp("Motivation is what gets you started. Habit is what keeps you going.","\u0627\u0644\u062a\u062d\u0641\u064a\u0632 \u0647\u0648 \u0645\u0627 \u064a\u062c\u0639\u0644\u0643 \u062a\u0628\u062f\u0623. \u0627\u0644\u0639\u0627\u062f\u0629 \u0647\u064a \u0645\u0627 \u064a\u062c\u0639\u0644\u0643 \u062a\u0633\u062a\u0645\u0631.")
B.a5f=new A.dp("A one-hour workout is only 4% of your day. No excuses.","\u062a\u0645\u0631\u064a\u0646 \u0644\u0645\u062f\u0629 \u0633\u0627\u0639\u0629 \u0647\u0648 4% \u0641\u0642\u0637 \u0645\u0646 \u064a\u0648\u0645\u0643. \u0644\u0627 \u0623\u0639\u0630\u0627\u0631.")
B.a5y=new A.dp("Sweat is just fat crying.","\u0627\u0644\u0639\u0631\u0642 \u0647\u0648 \u0645\u062c\u0631\u062f \u0628\u0643\u0627\u0621 \u0627\u0644\u062f\u0647\u0648\u0646.")
B.a5u=new A.dp("You don\u2019t have to be great to start, but you have to start to be great.","\u0644\u0627 \u064a\u062c\u0628 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0639\u0638\u064a\u0645\u064b\u0627 \u0644\u062a\u0628\u062f\u0623\u060c \u0648\u0644\u0643\u0646 \u064a\u062c\u0628 \u0623\u0646 \u062a\u0628\u062f\u0623 \u0644\u062a\u0643\u0648\u0646 \u0639\u0638\u064a\u0645\u064b\u0627.")
B.a5h=new A.dp("Success usually comes to those who are too busy to be looking for it.","\u0627\u0644\u0646\u062c\u0627\u062d \u0639\u0627\u062f\u0629 \u0645\u0627 \u064a\u0623\u062a\u064a \u0644\u0623\u0648\u0644\u0626\u0643 \u0627\u0644\u0630\u064a\u0646 \u0647\u0645 \u0645\u0634\u063a\u0648\u0644\u0648\u0646 \u062c\u062f\u064b\u0627 \u0628\u0627\u0644\u0628\u062d\u062b \u0639\u0646\u0647.")
B.a5c=new A.dp("Don't limit your challenges. Challenge your limits.","\u0644\u0627 \u062a\u062d\u062f \u0645\u0646 \u062a\u062d\u062f\u064a\u0627\u062a\u0643. \u062a\u062d\u062f\u0649 \u062d\u062f\u0648\u062f\u0643.")
B.a5o=new A.dp("Push yourself, because no one else is going to do it for you.","\u0627\u062f\u0641\u0639 \u0646\u0641\u0633\u0643\u060c \u0644\u0623\u0646\u0647 \u0644\u0627 \u0623\u062d\u062f \u0633\u064a\u0641\u0639\u0644 \u0630\u0644\u0643 \u0646\u064a\u0627\u0628\u0629 \u0639\u0646\u0643.")
B.a5k=new A.dp("Sometimes later becomes never. Do it now.","\u0623\u062d\u064a\u0627\u0646\u064b\u0627 '\u0644\u0627\u062d\u0642\u064b\u0627' \u064a\u0635\u0628\u062d '\u0623\u0628\u062f\u064b\u0627'. \u0627\u0641\u0639\u0644\u0647\u0627 \u0627\u0644\u0622\u0646.")
B.a5d=new A.dp("Great things never come from comfort zones.","\u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0627\u0644\u0639\u0638\u064a\u0645\u0629 \u0644\u0627 \u062a\u0623\u062a\u064a \u0623\u0628\u062f\u064b\u0627 \u0645\u0646 \u0645\u0646\u0627\u0637\u0642 \u0627\u0644\u0631\u0627\u062d\u0629.")
B.a5e=new A.dp("Dream it. Wish it. Do it.","\u0627\u062d\u0644\u0645 \u0628\u0647. \u062a\u0645\u0646\u0647. \u0627\u0641\u0639\u0644\u0647.")
B.a5z=new A.dp("Success doesn\u2019t just find you. You have to go out and get it.","\u0627\u0644\u0646\u062c\u0627\u062d \u0644\u0627 \u064a\u062c\u062f\u0643. \u0639\u0644\u064a\u0643 \u0623\u0646 \u062a\u062e\u0631\u062c \u0648\u062a\u062d\u0635\u0644 \u0639\u0644\u064a\u0647.")
B.a5l=new A.dp("The harder you work for something, the greater you\u2019ll feel when you achieve it.","\u0643\u0644\u0645\u0627 \u0639\u0645\u0644\u062a \u0628\u062c\u062f \u0645\u0646 \u0623\u062c\u0644 \u0634\u064a\u0621 \u0645\u0627\u060c \u0643\u0644\u0645\u0627 \u0634\u0639\u0631\u062a \u0628\u0634\u0639\u0648\u0631 \u0623\u0639\u0638\u0645 \u0639\u0646\u062f \u062a\u062d\u0642\u064a\u0642\u0647.")
B.a5A=new A.dp("Dream bigger. Do bigger.","\u0627\u062d\u0644\u0645 \u0623\u0643\u0628\u0631. \u0627\u0641\u0639\u0644 \u0623\u0643\u0628\u0631.")
B.a5t=new A.dp("Don\u2019t stop until you\u2019re proud.","\u0644\u0627 \u062a\u062a\u0648\u0642\u0641 \u062d\u062a\u0649 \u062a\u0643\u0648\u0646 \u0641\u062e\u0648\u0631\u064b\u0627.")
B.a5j=new A.dp("Focus on your goal. Don't look in any direction but ahead.","\u0631\u0643\u0632 \u0639\u0644\u0649 \u0647\u062f\u0641\u0643. \u0644\u0627 \u062a\u0646\u0638\u0631 \u0641\u064a \u0623\u064a \u0627\u062a\u062c\u0627\u0647 \u0633\u0648\u0649 \u0627\u0644\u0623\u0645\u0627\u0645.")
B.a5s=new A.dp("Every workout counts.","\u0643\u0644 \u062a\u0645\u0631\u064a\u0646 \u064a\u064f\u062d\u0633\u0628.")
B.a5w=new A.dp("Stronger than yesterday.","\u0623\u0642\u0648\u0649 \u0645\u0646 \u0627\u0644\u0623\u0645\u0633.")
